    event.preventDefault()
    console.log('button clicked', event.target)

    if (persons.includes(event.target.elements.newname.value)){
      Window.alert("eieieie")
    }

    setPersons([...persons,{name:event.target.elements.newname.value}])

  }



  return (
    <div>
      <h2>Phonebook</h2>
      <form onSubmit={addNote}>
        <div>
          name: <input type='text' name='newname' />
        </div>
        <div>
          <button type="submit">add</button>
        </div>
      </form>
      <h2>Numbers</h2>
      {<GetEm names={[persons,setPersons]}/>}
    </div>
  )

}






